  false,\n\t\"url\": null,\n\t\"notes\": \"These data were created as part of the
  National Oceanic and Atmospheric Administration Office for Coastal Management's
  efforts to create an online mapping viewer called the Sea Level Rise and Coastal
  Flooding Impacts Viewer. It depicts potential sea level rise and its associated
  impacts on the nation's coastal areas. The purpose of the mapping viewer is to provide
  coastal managers and scientists with a preliminary look at sea level rise (slr)
  and coastal flooding impacts. The viewer is a screening-level tool that uses nationally
  consistent data sets and analyses. Data and maps provided can be used at several
  scales to help gauge trends and prioritize actions for different scenarios. The
  Sea Level Rise and Coastal Flooding Impacts Viewer may be accessed at: http://www.coast.noaa.gov/slr
  This metadata record describes the digital elevation model (DEM) for the U.S. Virgin
  Islands of St.Croix, St. John, and St. Thomas. This DEM is a part of a series of
  DEMs produced for the National Oceanic and Atmospheric Administration Office for
  Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer described
  above. The DEMs created for this project were developed using the NOAA National
  Weather Service's Weather Forecast Office (WFO) boundaries. The U.S. Virgin Islands
  DEM includes the best available data known to exist at the time of DEM creation,
  that met project specifications for the U.S. Virgin Islands in the San Juan, PR
  WFO. This includes the coastlines of St. Croix, St. John, and St. Thomas. This DEM
  was derived from the 2013 NOAA Topographic Lidar for the U.S. Virgin Islands. A
  hydro-flattened DEM created from this data was provided by the contractor as a deliverable.
  The DEM is referenced vertically to the Virgin Islands Vertical Datum (VIVD09) with
  vertical units of meters and horizontally to the North American Datum of 1983 (NAD83).
  The resolution of the DEM is approximately 3 meters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
